import { Redirect } from "react-router-dom"
import {useState} from 'react'
import Header from './Header'
export default function Chose(props){
    if(!props.authorized){
        return <Redirect to="/"/>
    }
    
    return (
    <>
    <Header/>
    </>
    )
}
